import React,{Component} from 'react';

import {BrowserRouter, Route, Switch } from 'react-router-dom';
import App from './App'
import Page2 from './Page/'
export default () =>{
    return (
        <BrowserRouter>
        <Switch>
          <Route path="/" Component={App}></Route>  
            
        </Switch>
        </BrowserRouter>
    );
    }
